def emailreport_simple(reportfile, title, base, coverage='', crash='', anr='', tomb='', oom='', cpu='',mem =''):
    html = ""
    html += "<html>" + "\n"
    html += "<head>" + "\n"

    html += "	<meta charset=\"UTF-8\" />" + "\n"
    html += "	<title>%s</title>" % title + "\n"
    html += "	<style>" + "\n"
    html += "	table {border-collapse:collapse;} " + "\n"
    html += "	td {border:1px solid #AAA; padding:1px 4px 1px 4px; }" + "\n"
    html += "	.bgred {background-color:#FFAAAA;}" + "\n"
    html += "	.bgorange {background-color:#FF8040;}" + "\n"
    html += "	.nowrp {white-space:nowrap;}" + "\n"
    html += "	.fs {border: 1px solid #AAA; border-width:0px 0px 1px 0px; padding:1px 4px 1px 4px; white-space:nowrap;}" + "\n"
    html += "	.w100 {max-width:100px;}" + "\n"
    html += "	</style>" + "\n"
    html += "</head>" + "\n"
    html += "<body>" + "\n"

    html += "<h2>%s</h2>" %''+'\n'
    html += "<div style='font-size: 20px'>%s</div>" % title
    html += "<h4>%s</h4>" % '' + "\n"
    #html += "<HR style='FILTER:alpha(opacity=100,finishopacity=0,style=1)'color=#b20 SIZE=1> "
    html += "	<table>" + "\n"
    for (k, v) in base:
        html += "		<tr>" + "\n"
        html += "			<td>" + k + "</td>" + "\n"
        html += "			<td>" + v + "</td>" + "\n"
        html += "		</tr>" + "\n"
    html += "	</table>" + "\n"
    html += "<h4>%s</h4>" % ''+ "\n"
    html += "<div>%s</div>" % '崩溃:'
    html += '	<table>' + "\n"
    html += "		<tr>" + "\n"
    html += "			<td>" + '闪退' + "</td>" + "\n"
    html += '			<td  style="color:red;font-size: 13px">' + str(len(crash)) + "</td>" + "\n"
    html += "		</tr>" + "\n"
    html += "		<tr>" + "\n"
    html += "			<td>" + 'ANR' + "</td>" + "\n"
    html += '			<td  style="color:red;font-size: 13px">' + str(len(anr)) + "</td>" + "\n"
    html += "		</tr>" + "\n"
    html += "		<tr>" + "\n"
    html += "			<td>" + 'native层崩溃' + "</td>" + "\n"
    html += '			<td  style="color:red;font-size: 13px">' + str(len(tomb)) + "</td>" + "\n"
