    html += "		<tr>" + "\n"
    html += "			<td>" + 'oom' + "</td>" + "\n"
    html += '			<td  style="color:red;font-size: 13px">' + str(len(oom)) + "</td>" + "\n"
    html += "		</tr>" + "\n"
    html += "	</table>" + "\n"

    html += "<h4>%s</h4>" % '' + "\n"
    html += "<div>%s</div>" % '性能:'
    html += '	<table>' + "\n"
    html += '	<table>' + "\n"
    html += "		<tr>" + "\n"
    html += "			<td>" + '' + "</td>" + "\n"
    html += "			<td>" + 'max' + "</td>" + "\n"
    html += "			<td>" + 'avg' + "</td>" + "\n"
    html += "		</tr>" + "\n"

    html += "		<tr>" + "\n"
    html += "			<td>" + 'CPU(%)' + "</td>" + "\n"
    html += '			<td style="color:red;font-size: 13px">' + '%.1f' %max(map(float,cpu)) + "</td>" + "\n"
