def getbaseinfo(apppath,adb,udid,package):
    baseinfo=[]
    if os.path.splitext(apppath)[1] == '.apk':
        baseinfo.append(('包名:', package))
        baseinfo.append(('安装包:', os.path.basename(apppath)))
        baseinfo.append(('设备ID:', udid))
        model = adb.getdevicemodel()
        baseinfo.append(('机型:', model))
        androidversion = adb.getandroidversion()
        baseinfo.append(('版本:', 'Android %s' % androidversion))
