def datafromexcel(file):
    data = []
    with open(file,'r',encoding='utf-8')as csvfile:
        readlines = csv.reader(csvfile)
        for d in readlines:
            data.append((d))
    return data

def analyzeexceldata(list,countline,dataline,datarow,div=1):
    data = []
    try:
        count = list[countline - 1][-1]
        list = list[dataline-1:int(count)+dataline-1]
    except Exception:
        list = list[dataline-1:]
    for i in list:
        t = i[0]
        hour = int(t.split(':')[0])
        min = int(t.split(':')[1])
        sec = float(t.split(':')[2])
        time = float(hour*3600) + float(min*60) + sec
        v = i[datarow].replace('%','')
        data.append((time,float(v)/div))
    return data

